import React, { useState } from 'react';
import Cube from './components/Cube'
function App() {
  const [child,setChild] = useState()
  return (
    <div className="App">
      <Cube width={'450px'} height={'450px'} size={1} onRef={(c:any)=>{setChild(c)}}></Cube>
    </div>
  );
}

export default App;
